import React from "react";
import { Router, NavLink, Switch, Route } from "react-router-dom";
import { createBrowserHistory } from "history";
import "./Navigation.css";

function Navigation() {
  const newHistory = createBrowserHistory();
  return (
    <div className='Nav'>
      <Router history={newHistory}>
        <NavLink className='NavLink' to="/"><i class="fa fa-credit-card" aria-hidden="true"></i>Expenditure</NavLink>
        <NavLink className='NavLink' to="/transactions"><i class="fa fa-exchange" aria-hidden="true"></i>Transactions</NavLink>
        <NavLink className='NavLink' to="/overview"><i class="fa fa-bar-chart" aria-hidden="true"></i>Overview</NavLink>
        <NavLink className='NavLink' to="/overview"><i class="fa fa-bar-chart" aria-hidden="true"></i>Monthly</NavLink>
        <NavLink className='NavLink' to="/overview"><i class="fa fa-bar-chart" aria-hidden="true"></i>Yearly</NavLink>
        <NavLink className='NavLink' to="/overview"><i class="fa fa-bar-chart" aria-hidden="true"></i>All-to-date</NavLink>
        <Switch>
          <Route path="/"></Route>
          <Route path="/transactions"></Route>
          <Route path="/overview"></Route>
        </Switch>
      </Router>
    </div>
  );
}

export default Navigation;
